import './Navbar.css';
import { Link } from 'react-router-dom';

function Navbar() {
  return(
    <div className="navbar">
      <Link to="/">
        <img className="logo" src="webshio.png" alt=""/>
      </Link>
      <div className="items">
      <Link to="add-item">
        <img className="item" src="add.svg" alt=""/>
      </Link>
      <Link to="add-category">
        <img className="category" src="category.png" alt=""/>
      </Link>
      <Link to="cart">
        <img className="cart" src="cart.svg" alt=""/>
      </Link>
      </div>
    </div>
  );
}

// alumine tehke ise

export default Navbar;
